import React from 'react';
import classes from './AboutBlock.module.css';

export default function AboutBlock() {
  return (
    <div className={classes.about_block__wrapper}>
      <h2 className={classes.about_title}>О Компании</h2>
      <span className={classes.main_photo__text}>
        Аист-С - официальный дилер спецтехники Лонкинг, представляет на рынке РФ мини-погрузчики, экскаваторы и фронтальные погрузчики бренда Lonking. Наши сотрудники имеют большой опыт и детально изучили все аспекты приобретения, эксплуатации и обслуживания спецтехники в РФ.
      </span>
    </div>
    );
}
